//base
import React, { Fragment } from "react";

//material ui
import CssBaseline from '@mui/material/CssBaseline';
import Grid from '@mui/material/Grid';
import Paper from '@mui/material/Paper';
import Box from '@mui/material/Box';
import { createTheme, ThemeProvider, styled } from '@mui/material/styles';
import Card from '@mui/material/Card';
import CardActions from '@mui/material/CardActions';
import CardContent from '@mui/material/CardContent';
import Button from '@mui/material/Button';
import { Container, Typography } from "@mui/material";

const Logbook = () => {
    return (
        <Fragment>
            <CssBaseline />

            <Box sx={{ bgcolor: '#f7f5f0', height: '100vh' }}>
                <Grid container paddingTop={15} paddingLeft={5} >
                    <Typography variant="h4" component="div" style={{ fontWeight: 600 }} gutterBottom>
                        Form Log Book
                    </Typography>
                </Grid>
                <Container>
                <Grid container paddingLeft={5}>
                    <Card sx={{ minWidth: 275,width:'100%' }} >
                        <CardContent>
                            <Typography sx={{ fontSize: 14 }} gutterBottom>
                                Word of the Day
                            </Typography>
                           
                        </CardContent>
                        <CardActions>
                            <Button size="small">Learn More</Button>
                        </CardActions>
                    </Card>
                </Grid>
                </Container>
            </Box>

        </Fragment>
    )
}

export default Logbook;
